import React from 'react'
import s from './header.module.scss'
import headerBg from '../../assets/images/headerBg.png'

const Header = () => {
	return (
		<div className={s.header} style={{ backgroundImage: `url(${headerBg})` }}>
			Header
		</div>
	)
}

export { Header }
